import CreateMovie from '../pages/movies/CreateMovie';
import EditMovie from '../pages/movies/EditMovie';
import TableMovie from '../pages/movies/TableMovie';

import React from 'react';
import {
    Switch,
    Route
} from 'react-router-dom';
const Section = () => {


    return ( <
        >
        <
        section >
        <
        Switch >
        <
        Route exact path = "/" / >
        <
        Route exact path = "movies/tablemovies/create"
        component = {
            CreateMovie
        }
        /> <
        Route exact path = "movies/tablesmovies/edit/:id"
        component = {
            EditMovie
        }
        /> <
        Route exact path = "movies/tablemovies"
        component = {
            TableMovie
        }
        /> <
        /Switch> <
        /section> <
        />

    )
}
export default Section;
